import {
  useState,
  useEffect
} from "react";
import {getAllStudents} from "./client";
import './App.css';

function App() {

  const [students, setStudents] = useState([]);

  const fetchStudents = () => {
    getAllStudents()
        .then(res => res.json())
        .then(data => setStudents(data))
  }
  useEffect(() => {
    console.log("Component is mounted");
    fetchStudents();
  },[]);

  return <p>{students.length}</p>;
}

export default App;
